MIŠKAS tarp Biochemikų ir Fizikų g. (mieste!)
1) Nukritę medžiai, palikti kelmai, daugybė medžių šakų, pagalių. Gyventojų mylimas miškelis sunkiai praeinamas. Užleistas. Nesaugu vaikščioti;
2) Nėra numatytą konteinerių (specialių vietų prie įėjimų į miškelį) šunų ekskrimentams rinkti/męsti. Neatsakingi gyventojai, svečiai vedžioja šunis, viską palieka pačiame miškelyje, kartais ant praėjimo takų.

