2020 metų rugsėjo mėn 20 dieną prie Karmazinų piliakalnio papėdės, į sodybą atklydo haskio mišrūnas / sibiro haskis. Šuo draugiškas, bet labai apleistas, sukūdęs, alkanas, prastos kailio būklės. Šuo miegojo naktį prie sodybos, kitą dieną mes jį priglaudėme laikinai globai, kuri jau tapo ilgalaike, nes ieškojome savininko per skelbimus apylinkėse, apklausėme žmones, dėjome skelbimus į prieglaudų portalus - nieks neatsiliepė. 
Praėjo pusantrų metų. Šuo tvarkingai gyvena likęs mūsų namuose. 

